import Header from "../commons/Header/Header"
import Footer from "../commons/Footer/Footer"
import {Link} from "react-router-dom";

const MainPage = () => {

    return (
        <section className="mainPage">
            <Header />
            <>
                <h2>Welcome </h2>

                <Link to="/People"></Link>
            </>
            <Footer />

        </section>

    )
}

export default MainPage;
